ESSL30,NONE,
precision highp float;
precision lowp sampler3D;
in vec2 _vary_texture_coordinate;
in vec4 _vary_color;
uniform vec4 _constf_smoothing;
uniform sampler2D _tex_diffuse;
layout(location = 0) out vec4 _out_color;
void main()
{
	vec4 diffuse_sample = texture(_tex_diffuse, _vary_texture_coordinate);
	diffuse_sample.a = smoothstep(0.5f - _constf_smoothing.x, 0.5f + _constf_smoothing.x, diffuse_sample.a);
	_out_color = _vary_color * diffuse_sample;
}

